en absent anteriorly, but always conspicuous towards prescutelar space, where it forks and surrounds the area (occasionally the stripe may manifest as a small spot before the prescutellar area)','Scutal stripe of pale scales wide, complete','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_PionipsPunctorGroup',0,'Postmetasternal scales present, many; scutal fossa with about 23 setae on each side (19 to 27); prealar and supraalar setae combined, about 43 setae on each side (36 to 50)','Postmetasternal scales usually absent, rarely present but if so, few; scutal fossa with about 46 setae on each side (38 to 59); prealar and supraalar setae combined, about 86 setae on each side (72 to 100)','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_PosteriorScutalFossalSetae',0,'Posterior scutal fossal setae present','Posterior scutal fossal setae absent','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_PostprocoxalScales',0,'Postprocoxal scales present','Postprocoxal scales absent','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_Postspiracular',0,'Postspiracular setae absent','Postspiracular setae present','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_Prespiracular',0,'Prespiracular setae present','Prespiracular setae absent','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_Proboscis',0,'Proboscis bent sharply downwards and backwards, tapering distally','Proboscis more or less straight, if slightly curved, not pointing backwards, more or less the same thickness throughout','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_ProboscisRing',0,'Proboscis dark-scaled with pale ring near middle','Proboscis dark-scaled, if pale scales present, not forming medial ring','https://i.imgur.com/4ZL1L8e.png','https://i.imgur.com/4ZL1L8e.png'),('cp_ProboscisScales',0,'Proboscis with many dark and pale scales intermixed'